// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmControls 
} from '@vime/core';

import { define } from '../lib';


define('vm-controls', VmControls);


export interface ControlsProps extends JSX.VmControls, HTMLAttributes<HTMLVmControlsElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmControlsElement, ControlsProps>(
  'vm-controls',
  new Set(['hidden','fullWidth','fullHeight','direction','align','justify','pin','activeDuration','waitForPlaybackStart','hideWhenPaused','hideOnMouseLeave','isAudioView','isSettingsActive','playbackReady','isControlsActive','paused','playbackStarted']),
);
